import React, { Component } from 'react';
import './LoginPage.scss';

class LoginComponent extends Component {
    state = {}
    render() {
        return (
            <div className="row login-root">
                <div className="col-sm-4 offset-sm-4">

                    <div className="row login-field-box">
                        <div className="col">
                            <div>
                                <label className="label-cs">Username</label>
                                <label className="label-cs">*</label>
                                <input type="text" className="form-control" placeholder="Username" />
                            </div>

                            <div>
                                <label className="label-cs">Password</label>
                                <label className="label-cs">*</label>
                                <input type="password" className="form-control" placeholder="Password" />
                            </div>

                            <div>
                                <button className="btn btn-block login-btn" type="submit">Login</button>
                            </div>
                        </div>
                    </div>

                </div>
            </div>
        );
    }
}

export default LoginComponent;
